    salinity and other variables collected from discrete sample and profile observations
    using Alkalinity titrator, CTD and other instruments from the HUDSON in the Davis
    Strait, Labrador Sea and North Atlantic Ocean from 2005-05-26 to 2005-06-17 (NODC
    Accession 0108221)",nt"tracking_summary": {ntt"total": 3,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-09-26T21:27:11.311356",nt"name": "dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-d049ea",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0108221 includes chemical,
    discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
    Labrador Sea and North Atlantic Ocean from 2005-05-26 to 2005-06-17 and retrieved
    during cruise 18HU20050526 (HUD2005-016). These data include ALKALINITY, CHLOROFLUOROCARBON-11
    (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
    tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
    PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, Potential
    temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE and methyl chloroform
    (MC). The instruments used to collect these data include Alkalinity titrator, CTD,
    Coulometer for DIC measurement and bottle. These data were collected by Robert Gershey
    of BDR Research Ltd and Peter E. (retired) Jones of Bedford Institute of Oceanography
    as part of the CLIVAR_AR07W_2005 data set.nnThe International CLIVAR Global Ocean
    Carbon and Repeat Hydrography Program carries out a systematic and global re-occupation
    of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
